The most warmup challenge in the town...Love our #muacommunity !!!
So much love to my beautiful, happy, positive #muabombshell ... in full desi Avatar. 
My transformation look for the challenge is traditional avatar in Punjabi suit. The makeup is neutral in pinkish blusher, light grey eye makeup and complimenting pink shade lipstick. To get fresh and bright look, I have also touched highlighter to my tips.
Thank you girls for making “Stay At Home” so fun 💕
